class Solution {

    /**
     * @param Integer[][] $grid
     * @return Integer[][]
     */
    function constructProductMatrix($grid) {
        $n = count($grid);
        $m = count($grid[0]);
        $productMatrix = array_fill(0, $n, array_fill(0, $m, 0));
        $totalProduct = 1;
        $hasZero = false;
        $zeroCount = 0;

        // Calculate total product and check for zeros
        foreach ($grid as $row) {
            foreach ($row as $element) {
                if ($element === 0) {
                    $hasZero = true;
                    $zeroCount++;
                    continue;
                }
                $totalProduct = ($totalProduct * $element) % 12345;
            }
        }

        if ($zeroCount > 1) {
            // More than one zero means all elements in product matrix will be zero.
            return $productMatrix;
        }

        for ($i = 0; $i < $n; $i++) {
            for ($j = 0; $j < $m; $j++) {
                if ($hasZero) {
                    if ($grid[$i][$j] == 0) {
                        // Calculate product for the elements in the row and column of the zero.
                        $productMatrix[$i][$j] = $this->calculateProductExcludingSelf($grid, $i, $j);
                    } else {
                        $productMatrix[$i][$j] = 0;
                    }
                } else {
                    // If there's no zero, calculate product excluding the element itself.
                    $excludeElementProduct = $totalProduct * $this->modInverse($grid[$i][$j], 12345);
                    $productMatrix[$i][$j] = $excludeElementProduct % 12345;
                }
            }
        }

        return $productMatrix;
    }

    private function calculateProductExcludingSelf($grid, $excludeRow, $excludeColumn) {
        $product = 1;
        foreach ($grid as $i => $row) {
            foreach ($row as $j => $element) {
                if ($i === $excludeRow || $j === $excludeColumn || $element === 0) continue;
                $product = ($product * $element) % 12345;
            }
        }
        return $product;
    }

    private function modInverse($a, $m) {
        // Calculate Modular Inverse (Fermat's Little Theorem or Extended Euclidean Algorithm)
        // Placeholder implementation, actual implementation depends on the method chosen.
        for ($x = 1; $x < $m; $x++) {
            if (($a * $x) % $m == 1) {
                return $x;
            }
        }
        return 1; // In case there's no modular inverse (should not happen in this context)
    }
}
